        if (!is_null($this->container['originCountry']) && (mb_strlen($this->container['originCountry']) > 2)) {
            $invalidProperties[] = "invalid value for 'originCountry', the character length must be smaller than or equal to 2.";
        }

        if (!is_null($this->container['originCountry']) && (mb_strlen($this->container['originCountry']) < 2)) {
            $invalidProperties[] = "invalid value for 'originCountry', the character length must be bigger than or equal to 2.";
        }

        if ($this->container['quantity'] === null) {
